import React from 'react';
import { Button, Container, Stack, Row, Col } from 'react-bootstrap';
import { ArrowRightCircle } from 'react-bootstrap-icons';


function Home(){
    return (

        <Container className='justify-content-start mt-5'>
            <Row>
                <Col xs={12} md={6} xl={9}>
            <h1 className="title" style={{fontSize: 60}}>Your delivered expectations at just one click away</h1>
            <p className="subtitle pt-2" style={{fontSize: 25, }}>Calculate your services, whether you need a new website or an update, 
            and we will deliver the product based on your needs and expectations.</p>
            </Col>

            <Stack direction="horizontal" gap={4} className="call-to-action mt-5">
            <Button href="#pricecalculator" style={{fontSize: 20, fontWeight: "bold", backgroundColor: "#7F7EC7", color: "whitesmoke", borderBottom: "4px solid black"}} className="px-3 py-2">Get Started!</Button>{' '}
            <p className="pt-2" style={{fontWeight: "bold", fontSize: 18}}>or get in touch with us <ArrowRightCircle size={25} className="ms-2"/></p>
            </Stack>

            </Row>
        </Container>
    );
}

export default Home
